Creating flawless robot women that look identical to actual humans has become Johnny's specialty. So much so that he has offered his genius inventions to the public. One unhappy costumer storms into Johnny's house because of a major malfunction. Disappointed with his creation, Johnny inspects Jessica's internal hardware and tests her sex program.
